import React, { Component } from "react";
import './App.css';
import Navbar from "react-bootstrap/Navbar"
import Button from "react-bootstrap/Button"
import Card from "react-bootstrap/Card"

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      quotes: [],
      display: "Generate a quote by clicking the button below!"
    };
  }

  render() {
    return (
      <div className="App">
        <Navbar bg="light" expand="lg">
          <Navbar.Brand href="#home">Quote Generator</Navbar.Brand>
        </Navbar>

        <button className="btn btn-lg btn-primary" style={{ marginLeft: '25px', marginTop: "10vh" }} onClick={this.reset}>Reset</button>

      </div >
    );
  }
}

export default App;
